class TestPrettifyAllTransactions(unittest.TestCase):

	@given(st.lists(st.one_of(garbage_transactions, sampled_transactions)))
	def test_prettify_all_transactions_text_should_remain_in_bounds(
		self, transactions: list[Transaction]
	):
		pretty_texts = util.prettify_all_transactions(transactions)
		for text in pretty_texts:
			self.assertLessEqual(len(text), 2048)

	@given(st.lists(st.one_of(garbage_transactions, sampled_transactions)))
	def test_prettify_all_transactions_should_never_contain_empty_string(
		self, transactions: list[Transaction]
	):
		pretty_texts = util.prettify_all_transactions(transactions)
		for text in pretty_texts:
			self.assertIsNotNone(text)
			self.assertIsInstance(text, str)
			self.assertNotEqual(text, "")

	@given(st.lists(sampled_transactions))
	def test_prettify_all_transactions_should_render_all_transactions(
		self, transactions: list[Transaction]
	):
		pretty_texts = util.prettify_all_transactions(transactions)
		for text in pretty_texts:
			self.assertFalse(text.startswith("TODO:"))
			self.assertFalse(text.startswith("Failed:"))

	def test_prettify_all_transactions_empty(self):
		self.assertListEqual(util.prettify_all_transactions([]), [])


